            "ভিয়েতনামী আইন অনুসারে, ব্যবহারকারীদের তথ্য যেমন নাম, ইমেল ঠিকানা, পাসওয়ার্ড এবং জন্ম তারিখকে \"ব্যক্তিগত তথ্য হিসাবে শ্রেণীবদ্ধ করা যেতে পারে।\n\n নির্দিষ্টভাবে,\n (ক) ডিক্রি /201২/২০১৩ এর অধীনে, ব্যক্তিগত তথ্যকে সেই তথ্য হিসাবে সংজ্ঞায়িত করা হয় যা পরিচয় সনাক্তকরণ এবং নাম, বয়স, ঠিকানা, ব্যক্তির পরিচয় কার্ড নম্বর, টেলিফোন নম্বর, ইমেল ঠিকানা এবং অন্যান্য তথ্য সহ কোনও ব্যক্তির ব্যক্তিগত বিবরণের সাথে সংযুক্ত থাকে আইন দ্বারা নির্ধারিত হিসাবে\n\n (খ) বিজ্ঞপ্তি ২৫/২০১০ এর অধীনে, ব্যক্তিগত তথ্যের অর্থ কোনও ব্যক্তিকে সুনির্দিষ্টভাবে সনাক্ত করার জন্য পর্যাপ্ত তথ্য, যার মধ্যে অন্তত নিম্নলিখিত বিশদগুলির একটি অন্তর্ভুক্ত থাকে: পুরো নাম, জন্ম তারিখ, পেশা, শিরোনাম, যোগাযোগের ঠিকানা, ইমেল ঠিকানা, টেলিফোন নম্বর, পরিচয় কার্ড নম্বর এবং পাসপোর্ট নম্বর। ব্যক্তিগত গোপনীয়তার তথ্যের মধ্যে স্বাস্থ্য রেকর্ড, ট্যাক্স প্রদানের রেকর্ড, সামাজিক বীমা কার্ড নম্বর, ক্রেডিট কার্ড নম্বর এবং অন্যান্য ব্যক্তিগত গোপনীয়তা রয়েছে।\n\n বিজ্ঞপ্তি 25 ভিয়েতনামী সরকারী কর্তৃপক্ষ দ্বারা পরিচালিত ওয়েবসাইটগুলি দ্বারা ব্যক্তিগত তথ্য সংগ্রহ এবং ব্যবহারের ক্ষেত্রে প্রযোজ্য। সরকারী বিজ্ঞপ্তি 25 বেসরকারী সংস্থাগুলি দ্বারা পরিচালিত ওয়েবসাইটগুলি দ্বারা ব্যক্তিগত তথ্য সংগ্রহ এবং ব্যবহারের জন্য সরাসরি প্রযোজ্য নয়। যাইহোক, বিজ্ঞপ্তি 25 এর বিধানগুলি সাদৃশ্য দ্বারা প্রয়োগ করা যেতে পারে। তদুপরি, এটি সম্ভবত একটি বেসরকারী সত্তা সরকারী সত্তার সাথে প্রযোজ্য তার চেয়ে একই বা আরও কঠোর মানের সাপেক্ষে থাকবে।"),
